import React from "react";

export default function User(props){
    return (
        <div className="random-user">
            <div className="user-details">
                <div>
                    <strong>Name:</strong> {props.users.first} {props.users.last}
                </div>
                <div>
                    <strong>Email:</strong> {props.users.email}
                </div>
            </div>
        </div>
    );
};
